class School
{
    public string Name { get; set; }
    public List<Student> Students { get; set; }
    
    public School(string name)
    {
        Name = name;
        Students = new List<Student>();
    }
}

class Subject
{
    public string Name { get; set; }
    public string Teacher { get; set; }
    
    public Subject(string name, string teacher)
    {
        Name = name;
        Teacher = teacher;
    }
}

class Program
{
    static void Main()
    {
        School school = new School("–ì–∏–º–Ω–∞–∑–∏—è ‚Ññ1");
        
        Student student1 = new Student();
        student1.Subjects.Add(new Subject("–ú–∞—Ç–µ–º–∞—Ç–∏–∫–∞", "–ò–≤–∞–Ω –ò–≤–∞–Ω–æ–≤"));
        student1.Subjects.Add(new Subject("–ò—Å—Ç–æ—Ä–∏—è", "–ú–∞—Ä–∏—è –ü–µ—Ç—Ä–æ–≤–∞"));
        
        school.Students.Add(student1);
        
        Console.WriteLine("–£—á–∏–ª–∏—â–µ: " + school.Name);
        Console.WriteLine("–ë—Ä–æ–π —É—á–µ–Ω–∏—Ü–∏: " + school.Students.Count);
        
        foreach (var student in school.Students)
        {
            Console.WriteLine("–ü—Ä–µ–¥–º–µ—Ç–∏ –Ω–∞ —É—á–µ–Ω–∏–∫:");
            foreach (var subject in student.Subjects)
            {
                Console.WriteLine("- " + subject.Name + " (–ü—Ä–µ–ø–æ–¥–∞–≤–∞—Ç–µ–ª: " + subject.Teacher + ")");
            }
        }
    }
}
